import React, { useState, useEffect } from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      {<CryptoTable />}
    </div>
  );
}
export default App;


function CryptoTable() {

  const [data, setData] = useState("");
  var res = "";
  console.log(data)

  async function fetchData() {
    res = await fetch("http://localhost:8080/ExcerciseThursday/api/crypto");
    res.json().then(res => setData(res));
    console.log(data);
  }


  useEffect(() => {
    fetchData()
  }, []);

  return (
    <div>{<tableItems data={data} />}</div>
  )
}


function tableItems(data) {
  const res ="";
  for (const [key, value] of Object.entries(data)) {
    res += <TableItem symbol={key} value={value}/>
  }
  return res
}

function TableItem(props) {
  return <tr><th>{props.symbol}</th><th>{props.value}</th></tr>
}
